import React, { useEffect, useRef, useState } from 'react';
import { Link, useNavigate, useLocation } from 'react-router-dom';

const Navbar = () => {
  const token = localStorage.getItem('token');
  const adminToken = localStorage.getItem('adminToken');
  const navigate = useNavigate();
  const location = useLocation();

  const [activePath, setActivePath] = useState(location.pathname);
  const [beamStyle, setBeamStyle] = useState({});
  const navRefs = useRef({});

  useEffect(() => {
    const prev = navRefs.current[activePath];
    const next = navRefs.current[location.pathname];
    if (prev && next && prev !== next) {
      const prevRect = prev.getBoundingClientRect();
      const nextRect = next.getBoundingClientRect();
      const navRect = prev.parentElement.getBoundingClientRect();

      const beamLeft = Math.min(prevRect.left, nextRect.left) - navRect.left;
      const beamWidth = Math.abs(nextRect.left - prevRect.left) + nextRect.width;

      setBeamStyle({
        left: `${beamLeft}px`,
        width: `${beamWidth}px`,
        opacity: 1,
        animation: 'beamMove 0.5s ease-out'
      });

      setTimeout(() => {
        setBeamStyle({ opacity: 0 });
        setActivePath(location.pathname);
      }, 500);
    } else {
      setActivePath(location.pathname);
    }
  }, [location]);

  const handleLogout = () => {
    localStorage.clear();
    alert('Logged out');
    navigate('/login');
  };

  const navItems = [
    { to: "/", label: "🏠 Home" },
    { to: "/booklist", label: "📖 Books" },
    ...(adminToken
      ? [{ to: "/admin-dashboard", label: "🛠 Admin" }]
      : token
        ? [{ to: "/user", label: "👤 Profile" }]
        : [
            { to: "/login", label: "🔐 Login" },
            { to: "/register", label: "📝 Register" },
            { to: "/admin-login", label: "🛠 Admin Login" }
          ])
  ];

  return (
    <nav style={{
      position: "relative",
      padding: "12px 24px",
      backgroundColor: "#000",
      borderBottom: "1px solid #00ffff",
      boxShadow: "0 0 10px #00ffff",
      fontFamily: "'Orbitron', sans-serif",
      zIndex: 10
    }}>
      <div style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center"
      }}>
        <div style={{
          color: "#00ffff",
          fontSize: "20px",
          textShadow: "0 0 6px #00ffff"
        }}>
          📚 Library System
        </div>

        <ul style={{
          display: "flex",
          gap: "32px",
          listStyle: "none",
          margin: 0,
          padding: 0,
          position: "relative"
        }}>
          {/* Beam Element */}
          <div style={{
            position: "absolute",
            top: "100%",
            height: "2px",
            background: "linear-gradient(90deg, #00ffff, #00ffff)",
            boxShadow: "0 0 8px #00ffff",
            borderRadius: "2px",
            transition: "all 0.5s ease-out",
            ...beamStyle
          }} />

          {navItems.map(({ to, label }) => (
            <li key={to} ref={(el) => (navRefs.current[to] = el)} style={{ position: "relative" }}>
              <Link to={to} style={{
                color: "#00ffff",
                textDecoration: "none",
                fontSize: "14px",
                paddingBottom: "6px",
                textShadow: "0 0 4px #00ffff",
                borderBottom: activePath === to ? "2px solid #00ffff" : "2px solid transparent",
                transition: "border-bottom 0.3s ease"
              }}>
                {label}
              </Link>
            </li>
          ))}

          {(adminToken || token) && (
            <li>
              <button onClick={handleLogout} style={{
                background: "transparent",
                border: "1px solid #00ffff",
                color: "#00ffff",
                padding: "6px 12px",
                borderRadius: "4px",
                cursor: "pointer",
                fontSize: "13px",
                boxShadow: "0 0 6px #00ffff",
                textShadow: "0 0 4px #00ffff"
              }}>🚪 Logout</button>
            </li>
          )}
        </ul>
      </div>

      {/* Beam Animation Keyframes */}
      <style>{`
        @keyframes beamMove {
          0% { transform: scaleX(0); opacity: 0.2; }
          50% { transform: scaleX(1.2); opacity: 1; }
          100% { transform: scaleX(1); opacity: 1; }
        }
      `}</style>
    </nav>
  );
};

export default Navbar;
